_DESCRIPTION_:
Панель PERCo-PU01 предназначена для приема извещений от шлейфов сигнализации с пожарными и охранными извещателями или других приборов, преобразования сигналов, выдачи извещений о пожаре и/или проникновении с включением оповещения и других исполнительных устройств и передачи извещений на пульт централизованного наблюдения.

Блок управления и индикации PERCo-AU02 1-01 системы ОПС предназначен для автономного управления панелью: постановка/снятие с охраны шлейфов сигнализации и сброс различных состояний ППКОП, индикация состояний и режимов шлейфов, выходов оповещения и общих состояний ОПС PERCo-PU01 (пожар, тревога, неисправность).

Неадресные системы охранно-пожарной сигнализации (ОПС) — традиционно применяемые решения на рынке безопасности. Это относительно экономичные системы, обеспечивающие базовый набор функций ОПС. При выборе неадресной системы ОПС следует учитывать, что работоспособность системы и извещателей необходимо систематически проверять вручную, например, поднесением тлеющего шнура к извещателям или другими способами, в зависимости от типов датчиков.

Система ОПС на неадресных (пороговых) извещателях PERCo-PU01 позволяет:

контролировать состояние пожарных, охранных шлейфов сигнализации;
выдавать извещения о пожаре и/или проникновении на блоке индикации;
включать систему оповещения и другие исполнительные устройства комплексной системы безопасности;
передавать извещения на Пульт централизованного наблюдения, если он предусмотрен проектом.

Совместно с системой ОПС могут работать такие виды охранных датчиков, как:

инфракрасные, реагирующие на движение;
магнитоконтактные, реагирующие на размыкание дверей;
акустические, реагирующие на разбивание стекла.
